namespace RonSijm.FluidHumidifier.Factories.Synthetics;

public class CanaryFactory(string resourceName = null, Action<Humidifier.Synthetics.Canary> factoryAction = null) : ResourceFactory<Humidifier.Synthetics.Canary>(resourceName)
{

    internal InnerCanaryVisualReferenceFactory VisualReferenceFactory { get; set; }

    internal InnerCanaryArtifactConfigFactory ArtifactConfigFactory { get; set; }

    internal InnerCanaryVPCConfigFactory VPCConfigFactory { get; set; }

    internal InnerCanaryRunConfigFactory RunConfigFactory { get; set; }

    internal InnerCanaryCodeFactory CodeFactory { get; set; }

    internal InnerCanaryScheduleFactory ScheduleFactory { get; set; }

    protected override Humidifier.Synthetics.Canary Create()
    {
        var canaryResult = CreateCanary();
        factoryAction?.Invoke(canaryResult);

        return canaryResult;
    }

    private Humidifier.Synthetics.Canary CreateCanary()
    {
        var canaryResult = new Humidifier.Synthetics.Canary
        {
            GivenName = InputResourceName,
        };

        return canaryResult;
    }
    public override void CreateChildren(Humidifier.Synthetics.Canary result)
    {
        base.CreateChildren(result);

        result.VisualReference ??= VisualReferenceFactory?.Build();
        result.ArtifactConfig ??= ArtifactConfigFactory?.Build();
        result.VPCConfig ??= VPCConfigFactory?.Build();
        result.RunConfig ??= RunConfigFactory?.Build();
        result.Code ??= CodeFactory?.Build();
        result.Schedule ??= ScheduleFactory?.Build();
    }

} // End Of Class

